  /* 2017 */
  ('Jeff Kaufman and Julia Wise','Effective Altruism Funds: Infrastructure Fund',66000, 0.465, '2017-12-27', 'day', 'donation log', 'Effective altruism/movement growth', 'https://www.jefftk.com/donations', 'Donation to the EA Meta Fund (known at the time as the EA Community Fund, and managed by Nick Beckstead). See https://www.jefftk.com/p/2017-donations for more background on the donation decision. The total amount donated by the couple for 2017 is $142,000, out of which 50% ($71,000) is outside GiveWell-recommended charities. $5,000 of this was already donated to the EA Community Fund earlier in the year, leaving $66,000 which is donated in this donation.', NULL, NULL, 142000, NULL, NULL, NULL),
  ('Jeff Kaufman and Julia Wise','Schistosomiasis Control Initiative', 15000, 0.105, '2017-12-27', 'day', 'donation log', 'Global health/deworming', 'https://www.jefftk.com/donations', 'See https://www.jefftk.com/p/2017-donations for more background on the donation decision. Out of a total donation amount of $142,000 for 2017, the budget for GiveWell top charities is 50%; of this, 21% goes to the Schistosomiasis Control Initiative (this is a little less than the recommended 30%). We get 21% of 50% of $142,000, which is $15,000. The donation is via GiveWell', NULL, NULL, 142000, 'GiveWell', NULL, NULL),
  ('Jeff Kaufman and Julia Wise','Against Malaria Foundation',50000, 0.352, '2017-12-21', 'day', 'donation log', 'Global health/malaria', 'https://www.jefftk.com/donations', 'See https://www.jefftk.com/p/2017-donations for more background on the donation decision. Out of a total donation amount of $142,000 for 2017, the budget for GiveWell top charities is 50%; of this, 79% goes to the Against Malaria Foundation (this is a little higher than the 70% recommended by GiveWell); this works out to $56,000. Out of this, $6000 was already donated in January. The couple chose to donate directly to the top charities rather than to GiveWell for regranting, in order for Jeff to be able to participate in donation matching at work. The selection of PayPal Giving Fund was because it allowed the couple to use a 2% cash-back credit card and also give the charity an extra 1% match from PayPal (so $500)','PayPal Giving Fund', false, 142000, 'GiveWell', NULL, NULL),
